eval("module.exports = \"<p><translate>The mHealth Assessment and Planning for Scale (MAPS) Toolkit is a comprehensive self-assessment and planning guide designed to improve the capacity of projects to pursue strategies that increase their potential for scaling up and achieving long-term sustainability. MAPS is designed specifically for project managers and project teams who are already deploying an mHealth product, and who are aiming to increase the scale of impact. External parties seeking to understand the maturity and value of mHealth projects may also find value in using the Toolkit jointly with projects.</translate></p>\\n\\n<p><translate>The Toolkit covers six major areas (referred to as the “axes of scale”) that influence the scaling up of mHealth: Groundwork, Partnerships, Financial health, Technology &amp; architecture, Operations, and Monitoring &amp; evaluation. The axes of scale reflect the key concerns, activities and decisions that relate to these six areas.</translate></p>\\n\\n<p><translate>MAPS allows users to assess where projects stand in relation to each of the axes of scale, and to track progress as activities evolve and progress. The Toolkit will help project teams to identify areas that require further attention, and then to devise strategies to overcome any challenges or obstacles to progress. MAPS is designed to be used periodically at several time points throughout a project’s trajectory, guiding projects through an iterative process of thorough assessment, careful planning and targeted improvements. These steps facilitate successful scaling up of mHealth products.</translate></p>\\n\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/Common/Thematic/static/-1-2.html\n");

